import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import DataEntry from './components/DataEntry';
import BalancePlanning from './components/BalancePlanning';
import Simulations from './components/Simulations';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li><Link to="/">Carga de Datos</Link></li>
            <li><Link to="/balance">Balance y Planificaci√≥n</Link></li>
            <li><Link to="/simulaciones">Simulaciones</Link></li>
          </ul>
        </nav>

        <Switch>
          <Route path="/" exact component={DataEntry} />
          <Route path="/balance" component={BalancePlanning} />
          <Route path="/simulaciones" component={Simulations} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
